import React, {Component} from 'react'
import list from '../list.json'


class Inside extends Component {
    constructor(props) {
        super(props);
        state = {
            id: 0,
            isActive: false,
        }
    }
    render () {
        return (
            <div>
                <div>{list[this.props.id].dirs.map((dir) => (
                    <button>{dir}</button>
                ))}</div>
                <div>{list[this.props.id].files}</div>
            </div>
        )
    }
}

export default Inside;
